import HeaderImgLogo from '../assets/img/Group.png'
const HeaderJs  = [
    {
        navbar: [
            {
                img: [
                    {
                        img: HeaderImgLogo
                    }
                ],
                navbarText: [
                    {
                        text: 'Главная'
                    },
                    {
                        text: 'Про гида'
                    },
                    {
                        text: ''
                    }
                ],
                navbarButtonText: []
            }
        ]
    }
]
export default HeaderJs
